import http from "../http-common";

const getAll = () => {
  return http.get("/Dogadaji");
};

const get = id => {
  return http.get(`/Dogadaji/${id}`);
};

const create = data => {
  return http.post("/Dogadaji", data);
};

const update = (id, data) => {
  return http.put(`/Dogadaji/${id}`, data);
};

const remove = id => {
  return http.delete(`/Dogadaji/${id}`);
};

const removeAll = () => {
  return http.delete(`/Dogadaji`);
};

const findBynaziv = naziv => {
  return http.get(`/Dogadaji?naziv=${naziv}`);
};

eslint-disable-next-line

export default {
  getAll,
  get,
  create,
  update,
  remove,
  removeAll,
  findBynaziv
};
